Here in a new slimline set are the complete comic adventures of Britain's original Odd Couple, starring superstars Hugh Laurie and Stephen Fry. Join Jeeves &amp; Wooster for an enchanting romp through the drawing rooms and diversions of Britain's tweedy elite. Bertie Wooster is the classic young British man of means, blessed with a touch too generous a heart and a slight deficit in the noggin' department. Jeeves is his hilariously arch and resourceful valet, a &quot;Gentleman's Gentleman&quot; without equal who sees Bertie through the never-ending swirl of hopeless old friends, indomitable aunts, unbidden guests, and romantic entanglements that dominate his life. Jeeves &amp; Wooster The Complete Series includes all 23 episodes (1990-3) of the acclaimed series based on P. G. Wodehouse's beloved stories. Stephen Fry and Hugh Laurie are spot-on as the unflappable butler and his overwrought employer, and their inimitable misadventures are masterfully adapted for the screen by Clive Exton. Bonus features include a P.G. Wodehouse biography and filmography.

